import React, { useEffect, useState } from 'react';
import Button from '../components/Button';
import Input from '../components/Input';
import {useNavigate} from 'react-router-dom';
import {searchByWords} from '../api/auth';

const SearchWordsPage = () => {

  const navigate = useNavigate();
  const [links, setLinks] = useState<any>([]);

  const handleSearch = async () => {
    try {
    setLinks(await searchByWords());
    console.log(links);
    } catch (err: any) {
      console.log(err.message)
    }
  };

  return (
    <div className="text-white bg-zinc-900 m-auto h-screen max-w-[800px]">
      <h1 className='text-5xl p-5'>Buscar por p√°ginas</h1>
      <div className='flex p-5'>
				<Input placeholder='Buscar palabras...'/>
        <Button className="inline" onClick={handleSearch}> Search </Button>
      </div>

      <Button className="text-2xl" onClick={() => {navigate("/")}}>Volver a inicio</Button>
      (links && 
        <div className="max-h-96 overflow-y-auto">
          <ul role="list" >
          {links.map((links: any, index: any) => (
            <li className="bg-white border border-gray-300 rounded-lg p-4 shadow-md mb-4">
                <h2 className="text-xl font-semibold">links.words</h2>
                <p className="text-gray-700">links.link</p>
            </li>
          ))}
          </ul>
        </div>
      )
    </div>
  );
};

export default SearchWordsPage;
